import React from 'react'
import axios from 'axios'

function Note(props) {
    
    const handleDelete = async (note)  => {
        await axios.delete('/notes', note )
    }



    return (
        <div className = 'note'>
            <h1>{Note.title}</h1>
            <div>
                <span>{props.content}</span>
            </div>
            <button onClick = {handleDelete} > delete</button>

        </div>
    )
}

export default Note
